import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Linda',
          id: 'idnfe253e'
        },
        {
          name: 'Frank',
          id: 'nfe253e'
        },
        {
          name: 'Jackie',
          id: 'idnfe234325e'

        },
        {
          name: 'Andri',
          id: 'ide253e'
        }
      ]
    };
  }

  render() {
    return <div className="App">
      {
        this.state.monsters.map((monster)=> {
          return <div key = {monster.id}>
            <h1>{monster.name}</h1>
            </div>;
        })
      }
      </div>
  }
}

export default App;
